import React, { useState } from 'react';
import {
  Box,
  Typography,
  Grid,
  Paper,
  Card,
  CardContent,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  TablePagination,
  Button,
  TextField,
  MenuItem,
  FormControl,
  InputLabel,
  Select,
  IconButton,
  Tooltip
} from '@mui/material';
import {
  Download as DownloadIcon,
  Print as PrintIcon,
  FilterList as FilterListIcon,
  Refresh as RefreshIcon
} from '@mui/icons-material';

// Sample data for reports
const reportsData = [
  { id: 1, name: 'User Registration Report', type: 'User', lastGenerated: '2023-06-15', status: 'Ready' },
  { id: 2, name: 'Property Listing Report', type: 'Property', lastGenerated: '2023-06-14', status: 'Ready' },
  { id: 3, name: 'Monthly Sales Report', type: 'Sales', lastGenerated: '2023-06-10', status: 'Ready' },
  { id: 4, name: 'User Activity Log', type: 'User', lastGenerated: '2023-06-09', status: 'Ready' },
  { id: 5, name: 'Property Views Report', type: 'Analytics', lastGenerated: '2023-06-08', status: 'Ready' },
  { id: 6, name: 'Revenue Report', type: 'Finance', lastGenerated: '2023-06-01', status: 'Ready' },
  { id: 7, name: 'Customer Support Tickets', type: 'Support', lastGenerated: '2023-05-28', status: 'Ready' },
];

const reportTypes = [
  'All Types',
  'User',
  'Property',
  'Sales',
  'Analytics',
  'Finance',
  'Support'
];

const Reports = () => {
  const [page, setPage] = useState(0);
  const [rowsPerPage, setRowsPerPage] = useState(5);
  const [reportType, setReportType] = useState('All Types');
  const [searchQuery, setSearchQuery] = useState('');

  const handleChangePage = (event, newPage) => {
    setPage(newPage);
  };

  const handleChangeRowsPerPage = (event) => {
    setRowsPerPage(parseInt(event.target.value, 10));
    setPage(0);
  };

  const handleReportTypeChange = (event) => {
    setReportType(event.target.value);
    setPage(0);
  };

  const handleSearchChange = (event) => {
    setSearchQuery(event.target.value);
    setPage(0);
  };

  const filteredReports = reportsData.filter((report) => {
    const matchesSearch = report.name.toLowerCase().includes(searchQuery.toLowerCase());
    const matchesType = reportType === 'All Types' || report.type === reportType;
    return matchesSearch && matchesType;
  });

  const emptyRows =
    page > 0 ? Math.max(0, (1 + page) * rowsPerPage - filteredReports.length) : 0;

  return (
    <Box>
      <Box display="flex" justifyContent="space-between" alignItems="center" mb={3}>
        <Typography variant="h4" component="h1">Reports</Typography>
        <div>
          <Tooltip title="Refresh">
            <IconButton color="primary" sx={{ mr: 1 }}>
              <RefreshIcon />
            </IconButton>
          </Tooltip>
          <Button
            variant="contained"
            color="primary"
            startIcon={<DownloadIcon />}
            sx={{ mr: 1 }}
          >
            Export All
          </Button>
          <Button
            variant="outlined"
            startIcon={<PrintIcon />}
            sx={{ mr: 1 }}
          >
            Print
          </Button>
        </div>
      </Box>

      <Card sx={{ mb: 3 }}>
        <CardContent>
          <Grid container spacing={2} alignItems="center">
            <Grid item xs={12} md={4}>
              <TextField
                fullWidth
                label="Search reports"
                variant="outlined"
                size="small"
                value={searchQuery}
                onChange={handleSearchChange}
                InputProps={{
                  startAdornment: <FilterListIcon color="action" sx={{ mr: 1 }} />,
                }}
              />
            </Grid>
            <Grid item xs={12} md={3}>
              <FormControl fullWidth size="small">
                <InputLabel>Report Type</InputLabel>
                <Select
                  value={reportType}
                  label="Report Type"
                  onChange={handleReportTypeChange}
                >
                  {reportTypes.map((type) => (
                    <MenuItem key={type} value={type}>
                      {type}
                    </MenuItem>
                  ))}
                </Select>
              </FormControl>
            </Grid>
            <Grid item xs={12} md={3}>
              <TextField
                fullWidth
                label="Date From"
                type="date"
                size="small"
                InputLabelProps={{
                  shrink: true,
                }}
              />
            </Grid>
            <Grid item xs={12} md={2}>
              <Button fullWidth variant="contained" color="primary">
                Apply Filters
              </Button>
            </Grid>
          </Grid>
        </CardContent>
      </Card>

      <Paper>
        <TableContainer>
          <Table>
            <TableHead>
              <TableRow>
                <TableCell>Report Name</TableCell>
                <TableCell>Type</TableCell>
                <TableCell>Last Generated</TableCell>
                <TableCell>Status</TableCell>
                <TableCell align="right">Actions</TableCell>
              </TableRow>
            </TableHead>
            <TableBody>
              {(rowsPerPage > 0
                ? filteredReports.slice(page * rowsPerPage, page * rowsPerPage + rowsPerPage)
                : filteredReports
              ).map((report) => (
                <TableRow key={report.id} hover>
                  <TableCell>{report.name}</TableCell>
                  <TableCell>
                    <span
                      style={{
                        backgroundColor: getReportTypeColor(report.type).bg,
                        color: getReportTypeColor(report.type).text,
                        padding: '4px 8px',
                        borderRadius: '12px',
                        fontSize: '0.75rem',
                        fontWeight: 500,
                      }}
                    >
                      {report.type}
                    </span>
                  </TableCell>
                  <TableCell>{report.lastGenerated}</TableCell>
                  <TableCell>
                    <span
                      style={{
                        color: report.status === 'Ready' ? '#2e7d32' : '#ed6c02',
                        display: 'flex',
                        alignItems: 'center',
                      }}
                    >
                      <span
                        style={{
                          display: 'inline-block',
                          width: '8px',
                          height: '8px',
                          borderRadius: '50%',
                          backgroundColor: report.status === 'Ready' ? '#2e7d32' : '#ed6c02',
                          marginRight: '8px',
                        }}
                      />
                      {report.status}
                    </span>
                  </TableCell>
                  <TableCell align="right">
                    <Button
                      size="small"
                      color="primary"
                      startIcon={<DownloadIcon fontSize="small" />}
                      sx={{ mr: 1 }}
                    >
                      Download
                    </Button>
                    <Button size="small" startIcon={<PrintIcon fontSize="small" />}>
                      Print
                    </Button>
                  </TableCell>
                </TableRow>
              ))}
              {emptyRows > 0 && (
                <TableRow style={{ height: 53 * emptyRows }}>
                  <TableCell colSpan={5} />
                </TableRow>
              )}
            </TableBody>
          </Table>
        </TableContainer>
        <TablePagination
          rowsPerPageOptions={[5, 10, 25]}
          component="div"
          count={filteredReports.length}
          rowsPerPage={rowsPerPage}
          page={page}
          onPageChange={handleChangePage}
          onRowsPerPageChange={handleChangeRowsPerPage}
        />
      </Paper>
    </Box>
  );
};

// Helper function to get color based on report type
const getReportTypeColor = (type) => {
  const colors = {
    User: { bg: '#e3f2fd', text: '#1565c0' },
    Property: { bg: '#e8f5e9', text: '#2e7d32' },
    Sales: { bg: '#fff3e0', text: '#ef6c00' },
    Analytics: { bg: '#f3e5f5', text: '#7b1fa2' },
    Finance: { bg: '#e8eaf6', text: '#303f9f' },
    Support: { bg: '#fbe9e7', text: '#d84315' },
  };
  return colors[type] || { bg: '#f5f5f5', text: '#616161' };
};

export default Reports;
